function VotingInfo({ info }) {
    return (
        <div className="card mb-4">
            <div className="card-body">
                <h5 className="card-title">Voting Record</h5>
                <p className="card-text">Missed Vote Percentage: {info.missed_votes_pct}</p>
                <p className="card-text">Votes with Party Percentage: {info.votes_with_party_pct}</p>
                <p className="card-text">Votes against Party Percentage: {info.votes_against_party_pct}</p>
                <p className="card-text">Total Present Votes: {info.total_present}</p>
                <p className="card-text">Total Votes: {info.total_votes}</p>
            </div>
        </div>
    );
}

export default VotingInfo;
